def two_sum(numbers, target):
    # start coding!
    results = []
    for idx, num in enumerate(numbers):
        search = target - num
        if not results:
            for idx2, integer in enumerate(numbers):
                if integer == search:
                    if idx != idx2:
                        results.append((idx, idx2))
    res = results[0]       
    print(results)
    print(res)
    return res


