# two_sum([1234,5678,9012], 14690)    # [1,2]
# two_sum([2,2,3], 4)                 # [0,1]


def small_two_sum(nums, t):
    for i, x in enumerate(nums):
        for j, y in enumerate(nums):
            if i != j and x + y == t:
                return [i, j]

print(small_two_sum([1234,5678,9012], 14690))


#hash map 2 sum

def hash_two_sum(numbers, target):
    prevMap = {}
    
    for idx, num in enumerate(numbers):
        goal = target - num
        
        if goal in prevMap.values():
            keys_ls = list(prevMap.keys())
            vals_ls = list(prevMap.values())

            key = keys_ls[vals_ls.index(goal)]
            return [key, idx]
        
        prevMap[idx] = num    


